end

train_data_per_file = round(total_data_per_file*distribution);

test_data_per_file = round(total_data_per_file*(1-distribution));
train_data = zeros(train_data_per_file*total_files, 785); % Tan√≠t√≥ halmaz inicializ√°l√°sa
