        % 2D m√°trix √°talak√≠t√°sa 1D vektorr√°, ahol 0 van a m√°trixban, ott is 0 marad, egy√©bk√©nt 1
        t_vector = double(t(:)'./255);
        t_vector_with_ones = [1, t_vector]; % Minden sor elej√©re besz√∫runk egy 1-est

        if i <= train_data_per_file
            % Tan√≠t√≥ halmazba ment√©s
