				$query = "select max(PRINTORDER) as LASTORDER from STUDENTSTUDYCARD ".
						" where STUDENTID='".$this->studentId."' and SEMESTER='".$this->semester."' and SCHOOLYEAR='".$this->schoolYear."' ";
