				$this->Update("STUDENTSTUDYCARD",array("EXPIREDSTATUS"=>"'YA'","EXPIREDDATE"=>"SYSDATE"),"STUDENTID='".$this->studentId."' and (EXPIREDSTATUS='TIDAK' or EXPIREDSTATUS is null)");				
				foreach($dataFix as $key=>$val) {
